How to upsert in a mongodb nested object without losing existing unreferenced fields<p>I'm using C# in dot net to create and update simple collections in mongodb (I'm new to nosql having done only mysql). Creation is no problem, and neither is updating for the most part. But I have a nested object that on update will likely contain existing fields. If the request does not use those fields, only the referenced fields i.e. those to insert or update will be added- the existing ones are lost.</p>

<p>Searched for similar problems on here but found nothing quite matching. Some references to methods AddToSet and AddToSetEach, but don't think they are quite appropriate here.</p>

<p>Found mentions of fetching the existing document first and updating that, but figured that could get messy and that this must be a common problem with a straight-forward solution.</p>

<p>Code for updationg (abridged) is very simple really:</p>

<pre><code>public class Issue {
        public string Id { get; set; }
        public IDictionary&lt;string, string&gt; Properties { get; set; }
        public string AssignedToUserId { get; set; }
    }

var issue = new Issue {
                    Id = "MEC0eNrSQk2ZhDJnZ3f36g",
                    AssignedToUserId = "someuserid",
                    Properties = new Dictionary&lt;string, string&gt;
                    {
                        { "prop2", "ghj" },
                        { "prop3", "xyz" }
                    };
}

var update = Builders&lt;Issue&gt;.Update
                .Set(x =&gt; x.AssignedToUserId, issue.AssignedToUserId)
                .Set(x =&gt; x.Properties, issue.Properties);

await _mongoDb.UpdateOneAsync(Builders&lt;Issue&gt;.Filter.Eq(x =&gt; x.Id, issue.Id), update);
</code></pre>

<pre><code>Document on creation (abridged):
{
"_id" : "MEC0eNrSQk2ZhDJnZ3f36g",
"Properties" : {
    "prop1" : "abc",
    "prop2" : "def"
},
"AssignedToUserId" : null
}
</code></pre>

<p>I wish to update the properties object by:
Changing the value of <code>prop2</code> to <code>ghj</code>
adding a new field <code>prop3</code> with some arbitrary value
[and leave prop1 the hell alone!]</p>

<p>The result (abridged to only show properties object)</p>

<pre><code>  "Properties" : {
   "prop2" : "ghj"
   "prop3" : "xyz"
   }
</code></pre>

<p>So the new property was added, the existing property I wanted changing was changed ok, but <code>prop1</code> is lost.</p>

