Collections Referencing in MongoDb and fetching data<p>Issue with Creating Relations in Collection in MongoDB to fetch Data through REST API</p>

<p>I am new to NodeJs and MongoDB, I am trying to develop a REST API that fetched data for categories and products. I am trying to create a relation b/w the categories and product such that when queried for a particular category, only those products should be fetched from the DB</p>

<p>I have tried fetching data from categories and then passed the _id into products to fetch the related products. </p>

<h1>Categories.js Schema</h1>

<pre><code>const mongoose = require('mongoose')
const uniqueValidator = require('mongoose-unique-validator')

const categoriesSchema = mongoose.Schema({
    name: { 
        type: String,
        unique: true,
    }
})
categoriesSchema.plugin(uniqueValidator)
module.exports = mongoose.model('Categories', categoriesSchema)
</code></pre>

<h1>Prodcuts.js Schema</h1>

<pre><code>const mongoose = require('mongoose');

const  ProductSchema =  mongoose.Schema({
    category:{
    type: String
    },
    name:{
        type: String,
        required: true,
        trim: true,
        lowercase: true
    } ,
    description: {
        type: String,
        required: true,
        trim: true,
        lowercase: true
    } ,
    quantity: {
        type: Number,
        required: true,
        trim: true,
        default:0
    } ,
    color: {
        type: String,
        required: true,
        trim: true,
        lowercase: true
    } ,
    price: {
        type: Number,
        required: true,
        trim: true,
        default:0
    } 
});
module.exports = mongoose.model('Product', ProductSchema);
</code></pre>

<h1>Home.js Route</h1>

<pre><code>const express = require('express')
const router = express.Router()

const productModel = require('../models/products')
const categoriesModel = require('../models/categories')


router.get('', async (req, res) =&gt; {
    categroyFetched = []
    productsFecthed =[]
    await categoriesModel.find({})
        .then(categories =&gt; {
            categroyFetched = categories.map(category =&gt; {
                return{
                    name: category.name, 
                    id: category._id
                }
            })

            return category = {
                count: categroyFetched.length,
                name: categroyFetched
            }
        })
       .then(async()=&gt;{
        await productModel.find({category: categroyFetched.id})
        .then(products =&gt; {

            productsFecthed = products.map(product =&gt; {
                return product
            })

        })

       })
       .catch(err =&gt; {
        console.log('err', err)
    })

    res.status(200).json({
        category, productsFecthed
    })

})

module.exports = router
</code></pre>

<p>I need help in establishing the relation in Category and Products Schema and later how I can use it in Home.js Route to extract Data. and Also while creating the Products, what format of Json Data need to be sent to incorporate reference to Category Collection.</p>

