How to push an array field value if that array field value dont exist in database?<p>I have this function on my backend:</p>
<pre><code>exports.updatePacienteByCodigo = function (req, res) {
let codPaciente = req.params.codPaciente;
let params = req.body; // This is the data what come from frontend = {'testRealizados':['example'], 'respuestas':['example'], 'codMedico':'example'}
Paciente.findOneAndUpdate({ codPaciente: codPaciente }, {
    '$push': {
        'testsRealizados': params.testsRealizados,
        'respuestas': params.respuestas,
        'codMedico': {'$ne':params.codMedico} //here is the problem
    }
}).then(
    pacienteEncontrado =&gt; {
        if (!pacienteEncontrado) {
            res.status(404).send({ accion: 'updatePaciente', mensaje: 'Ese paciente no existe' });
        } else {
            res.status(200).send({ accion: 'updatePaciente', mensaje: 'Paciente actualizado correctamente' });
        }
    }
).catch(err =&gt; { res.status(500).send({ accion: 'updatePaciente', mensaje: 'Error ' + err }) })
};
</code></pre>
<p>This query throw me this error <code>&quot;Error CastError: Cast to [string] failed for value \&quot;[{\&quot;$ne\&quot;:\&quot;o8qjdeli\&quot;}]\&quot; at path \&quot;codMedico\&quot;&quot;}</code></p>
<p>What I want to do is, if <code>codMedico</code> have the same value in the database than the param codMedico dont update that field.</p>
<p>I tried that but that didnt work. I am out of ideas so here I am. Thanks.</p>
<h1>[SOLVED]</h1>
<p>I tried with $addToSet method and it works perfectly like @Plancke told me in the comments.</p>

