Summation of an array of array of numbers<p>I would like to find a total based on two arrays <code>pbd</code> and <code>input</code>.
The pipeline should multiply the <code>pbd.charge.sellRate</code> with the <code>input.quantity</code> whenever the type and size matches. Also I would like to add all this together to get one grand total.</p>

<p>The input would be </p>

<pre><code>  {
    "pbd": [
      {
        "type": "STD",
        "size": "20",
        "charge": {
          "sellRate": 120
        }
      },
      {
        "containerType": "STD",
        "containerSize": "40",
        "charge": {
          "sellRate": 290
        }
      }
    ],
    "input": [
      {
        "type": "STD",
        "size": "20",
        "quantity": "20"
      },
      {
        "type": "STD",
        "size": "40",
        "quantity": "20"
      }
    ]
  }
</code></pre>

<p>So far I've used two <code>$map</code> operators somewhat like two for loops like this:</p>

<pre><code>db.collection.aggregate([
  {
    $project: {
      "grandTotal": {
        $map: {
          input: "$pbd",
          as: "pbd",
          in: {
            $map: {
              input: "$input",
              as: "inp",
              in: {
                $cond: {
                  if: {
                    $and: [
                      {
                        $eq: [
                          "$$pbd.type",
                          "$$inp.type"
                        ]
                      },
                      {
                        $eq: [
                          "$$pbd.size",
                          "$$inp.size"
                        ]
                      }
                    ]
                  },
                  then: {
                    $multiply: [
                      {
                        $toInt: "$$pbd.charge.sellRate"
                      },
                      {
                        $toInt: "$$inp.quantity"
                      }
                    ]
                  },
                  else: 0
                }
              }
            }
          }
        }
      }
    }
  }
])
</code></pre>

<p>and the output I get is this </p>

<pre><code>  {
    "_id": ObjectId("5a934e000102030405000000"),
    "grandTotal": [
      [
        2400,
        0
      ],
      [
        0,
        0
      ]
    ]
  }
</code></pre>

<p>Now I want to add all this array of arrays to get one total. A better solution to this problem would also be highly appreciated.</p>

<p>This is a part of quite a long aggregation pipeline with lots of other data so I would prefer to not unwind and group the data. Is there any other option?</p>

