How to achieve strongly typed static schema functions using Mongoose with Typescript?<p>I am wondering what's the best way to achieve strongly typed static functions for Mongoose Schemas when using TypeScript. </p>

<p>I have a solution right now, but it feels messy and adds a lot of extra code if it has to be done for each schema. I will present it at the bottom of this post, but will show the current setup first:</p>

<p>I have the following interfaces:</p>

<p><code>interfaces/Player.ts</code></p>

<pre class="lang-js prettyprint-override"><code>export interface Player {
  name: string
  password: string
}

export interface PlayerDocument extends Player, Document {
   // statics
   findByName(name: string): any
};
</code></pre>

<p>The reason I have two interfaces here is because I want to be able to use the Player interface without the Mongoose-bindings as well other places in the app. PlayerDocument here represent the schema-ready interface, which we will use here:</p>

<p><code>schemas/Player.ts</code></p>

<pre class="lang-js prettyprint-override"><code>
const playerSchema = new mongoose.Schema({
  name:  { type: String, required: true, unique: true },
  password: String,
});

// Not using arrow functions because they prevent binding this. 
// See mongoose-docs
playerSchema.statics.findByName = function(name: string) {
  return this.find({ name: new RegExp(name, 'i') });
}

interface test {
  findByName(name: string): any
}

export default mongoose.model&lt;PlayerDocument&gt;('Player', playerSchema);

</code></pre>

<p>The problem here, is that whenever I am now using the schema in other places of the app, I am not getting the static function <code>findByName(name: string): any</code> present in the type.</p>

<p><code>app.ts</code></p>

<pre class="lang-js prettyprint-override"><code>import PlayerSchema from './schemas/Player';
const test = async () =&gt; {
    const x = await PlayerSchema.findByName('Erlend');
    console.log(x);
}
</code></pre>

<p>This gives:</p>

<p><a href="https://i.stack.imgur.com/w6weT.png" rel="nofollow noreferrer"><img src="https://i.stack.imgur.com/w6weT.png" alt="code hint not appearing"></a></p>

<h2>My solution, which seems hacky</h2>

<p>I managed to solve the issue by creating the following combined type:</p>

<p><code>schemas/Player.ts</code></p>

<pre class="lang-js prettyprint-override"><code>interface test {
    findByName(name: string): any
}
type something = mongoose.Model&lt;PlayerDocument&gt; &amp; test;
export default (mongoose.model&lt;PlayerDocument&gt;('Player', playerSchema)) as something;
</code></pre>

<p>Aand finally:</p>

<p><a href="https://i.stack.imgur.com/Khm7Q.png" rel="nofollow noreferrer"><img src="https://i.stack.imgur.com/Khm7Q.png" alt="code hint appearing"></a></p>

<p>But as explained above, I feel like there should be a better way.. Ideas?</p>

