<p>This solution returns only the list of members, so what i have to do to get a list containing all the resellers, the clients and the members all together?</p>; Answer: @copper.hat, Note that technically in stock Tcl interpreter (I mean, "official" -- other implementations are free to use different approaches) each *scope* (procedure, namespace, interp-global) has a "variable table", and that's what gets manipulated by commands such as `variable` and `global`. Any variable lookup first hits this table in the current scope; rules for looking up further scopes differ between procs and namespaces (I think this might have something to do with backwards-compatibility and "the least WTF principle" as Tcl not always had namespaces).

