<pre><code>[
{
  "name":"kachina chasmata",
  "location":{
    "type":"Point",
    "coordinates":[-116.65,-32.6]
  },
  "body":"ariel"
},
{
  "name":"hokusai",
  "location":{
    "type":"Point",
    "coordinates":[16.65,57.84]
  },
  "body":"mercury"
},
{
  "name":"cañas",
  "location":{
    "type":"Point",
    "coordinates":[89.86,-31.188]
  },
  "body":"mars"
},
{
  "name":"anseris cavus",
  "location":{
    "type":"Point",
    "coordinates":[95.5,-29.708]
  },
  "body":"mars"
}
]
</code></pre>

<p>Currently, (Eve) settings declare a <code>DOMAIN</code> as follows:</p>

<pre class="lang-py prettyprint-override"><code>crater = {
    'hateoas': False,
    'item_title': 'crater centroid',
    'url': 'centroid/&lt;regex("[\w]+"):body&gt;/&lt;regex("[\w ]+"):name&gt;',
    'datasource': {
        'projection': {'name': 1, 'body': 1, 'location.coordinates': 1}
    }
}

DOMAIN = {
    'centroids': crater,
}
</code></pre>

<p>Which will successfully answer to requests of the form <code>http://hostname/centroid/&lt;body&gt;/&lt;name&gt;</code>. Inside MongoDB this represents a query like: <code>db.centroids.find({body:&lt;body&gt;, name:&lt;name&gt;})</code>.</p>

<p>What I would like to do also is to offer an endpoint for <em>all</em> the documents of a given <code>body</code>. I.e., a request to <code>http://hostname/centroids/&lt;body&gt;</code> would answer the list of all documents with <code>body==&lt;body&gt;</code>: <code>db.centroids.find({body:&lt;body&gt;})</code>.</p>

<p><em>How do I do that?</em></p>

<p>I gave a shot by including a list of rules to the <code>DOMAIN</code> key <code>centroids</code> (the name of the database collection) like below,</p>

<pre class="lang-py prettyprint-override"><code>crater = {
...
}

body = {
    'item_title': 'body craters',
    'url': 'centroids/&lt;regex("[\w]+"):body&gt;'
}

DOMAIN = {
    'centroids': [crater, body],
}
</code></pre>

<p>but didn't work...</p>

<pre><code>AttributeError: 'list' object has no attribute 'setdefault'
</code></pre>

