Spring MongoDB - Difference between @Indexed and @Field annotations<p>I am trying to understand how the two different annotations of <code>@Indexed</code> and <code>@Field</code> differ while defining a model in Java Spring Boot. <br></p>

<pre><code>public class Notation {
    @Id
    private String id;

    @Field("value")
    private String value;

    @Field("description")
    private String description;

    @Field("frequency")
    private int frequency;
}
</code></pre>

<pre><code>public class Notation {
    @Id
    private String id;

    @Indexed("value")
